import React from "react";
import "./Header.css";
import { Col, Container, Row } from "react-bootstrap";
function Header() {
  return (
    <header className="header">
      <div className="container">
        <Col xs={1}>
          <div className="logo">Your Logo</div>
          <nav className="navigation">
            <ul>
              <li>
                <a href="#">Home</a>
              </li>
              <li>
                <a href="#">About</a>
              </li>
              <li>
                <a href="#">Services</a>
              </li>
              <li>
                <a href="#">Contact</a>
              </li>
            </ul>
          </nav>
        </Col>
        <Col xs={2}>
          <div className="logo">Your Logo</div>
          <nav className="navigation">
            <ul>
              <li>
                <a href="#">Home</a>
              </li>
              <li>
                <a href="#">About</a>
              </li>
              <li>
                <a href="#">Services</a>
              </li>
              <li>
                <a href="#">Contact</a>
              </li>
            </ul>
          </nav>
        </Col>
        <Col xs={3}>
          <div className="logo">Your Logo</div>
          <nav className="navigation">
            <ul>
              <li>
                <a href="#">Home</a>
              </li>
              <li>
                <a href="#">About</a>
              </li>
              <li>
                <a href="#">Services</a>
              </li>
              <li>
                <a href="#">Contact</a>
              </li>
            </ul>
          </nav>
        </Col>
      </div>
    </header>
    // <header className="header">
    //   <Row className="top-screen parent-row">
    //     <Col xs={1} className="black-background">
    //       {/* Left Section */}
    //     </Col>
    //     <Col
    //       xs={10}
    //       className="image-column background-image "
    //       style={{ overflow: "hidden" }}
    //     ></Col>

    //     <Col xs={1} className="black-background">
    //       {/* Right Section */}
    //     </Col>
    //   </Row>
    // </header>
  );
}

export default Header;
